export default makeStyles(() => ({
    root: {
        justifyContent: "center",
        alignItems: "center",
    },
    text: {
        textAlign: "center",
    },
    button: {},
    item: {
        padding: "5%",

        display: "flex",
        justifyContent: "center",
        alignItems: "center",
    },
}));
